package ch04;

public class overloadTest01 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("하이");   // String 타입 매개변수 대입
		System.out.println(10);   // int 타입 매개변수 대입
		System.out.println(5.95);  // double 타입 매개변수 대입
		System.out.println(true);  // boolean 타입 매개변수 대입
	}

}
